  input: 'TEXT,F3XA,,"First, (Schedule B: Allocation of Expenses) the NJSLPAC/LPL
    (an SSF) is registered as both a federal and non-federal state PAC. The federal
    PAC acts as the collecting entity, which periodically transfers monies to both
    our affiliated organization (LPL) and to our non-federal state PAC. Accordingly,
    all federal expenses are paid by the connected organization and all non-federal
    expenses are paid by the non-federal PAC. Second, (Line 11(a)(ii) Unitemized Receipts)
    according to the April Quarterly Report, this Committee discloses a receipt totaling
    $57,155.18 in unitemized receipts from individuals / persons other than politcal
    committees during the reporting period. All unitmeized receipts are comprised
    of contributions from individuals under $200 in the aggregate. Third, I have requested
    a refund from both Chellie Pingrie for US Senate and Friends of Senator Rockefeller
    as a result of an excessive contribution to each of those campiagn committees.  The
    refunds will be properly reported as such once received."'
